import React from "react";

export const Tile = (props) => {
  const array = Object.values(props.contact);
  return (
    <div className="tile-container">
      {array.map( contact => {
        <>
          <p className="tile-title">{contact.name}</p>
          <p className="tile"></p>
        </>  
        })
      }
    </div>
  );
};
